function() {
        var patient = this;
        var effective_date = <%= effective_date %>;

        hqmfjs = {}
        <%= init_js_frameworks %>


      var patient_api = new hQuery.Patient(patient);



      // clear out logger
      if (typeof Logger != 'undefined') { Logger.logger = []; Logger.rationale={};}
      // turn on logging if it is enabled
      if (Logger.enabled) enableLogging();


        // #########################
        // ##### DATA ELEMENTS #####
        // #########################

